INSERT INTO `tb_board` VALUES (1,2004,1,'1',1,'','정부 사립탐정부터 이혼 전문가 까지 신직업 40개 육성','<STRONG>고용노동부, 자격증 신설 등 신직업 육성계획 국무회의 보고<BR><BR></STRONG>(세종=뉴스1) 한종수 기자 = # 다국적 회사인 A사는 자사 제품을 불법 복제하는 행위로 골머리를 앓다가 \'민간조사업체\'에 의뢰해 복제품을 적발하고 민간조사원(사설탐정)이 수집한 증거를 토대로 수사시관에 고발조치할 수 있었다. <BR><BR># 부동산중개사에 1년간 집을 내놓아도 팔리지 않았던 집주인은 \'매매주택연출가\'에 의뢰해 집안의 가구 재배치, 도배·페인팅, 조명 교체 등 집을 새롭게 연출한 뒤 다시 내놓았고 시세보다 높은 가격에 집을 팔 수 있었다. <BR><BR>유럽·미국 등 선진국에서 흔히 볼 수 있는 일이지만 몇 년 후에는 한국에서도 실현 가능한 직업이다. 정부가 사설탐정, 매매주택연출가, 전직지원전문가, 빅데이터전문가 등을 포함한 신직업 40여 개를 육성해 적극 지원하겠다고 18일 밝혔다.<BR><BR>신직업 육성은 민간에서 자생적으로 나올 수 있도록 측면 지원 방식이다. 새 직업 창출을 저해하는 규제를 완화하는 한편 민간자격 신설 등 법률개정, 인프라 구축으로 민간시장에서 직업창출이 이뤄지도록 유도하겠다는 것이다. <BR><BR>특히 유망 과학기술 분야에 대한 투자를 늘리고 신직업을 공공서비스부터 도입한 후 민간시장에서 직업 창출이 자연스럽게 이어지게 할 계획이다.<BR><BR>고용노동부는 기획재정부, 미래창조과학부, 경찰청 등 관계부처와 함께 18일 박근혜 대통령 주재로 서울-세종시 간 이원 생중계로 열린 첫 영상 국무회의에서 이같은 내용을 뼈대로 한 \'신(新)직업 육성 추진계획\'을 보고했다. <BR><BR>신직업 종류도 다양하다. 이른바 사립탐정이라 불리는 민간조사원부터 협동조합코디네이터, 소셜미디어전문가, 주거복지사, 문화여가사, 동물간호사, 도시재생전문가, 홀로그램전문가, 임신출산육아전문가, 이혼상담사, 디지털장의사까지 40여 개에 이른다. <BR><BR>신직업은 해당 관계부처에서 협의체를 구성해 구체적인 도입방안과 자격신설 일정, 관련 교육프로그램 개설 등을 논의한 후 국민 의견수렴과 법률검토를 거쳐 빠르면 올해부터 순차적으로 도입할 계획이다. <BR><BR>방하남 노동부 장관은 \"신직업 발굴·육성은 창조경제 실현 및 일자리 창출을 위한 새로운 대안\"이라며 \"신직업을 통해 더 많은 일자리가 나올 수 있도록 현장의 목소리에 귀 기울이며 부족한 부분은 계속 보완해 나가겠다\"고 밝혔다.<BR><BR><BR>원문 <A href=\"http://news.naver.com/main/read.nhn?mode=LSD&amp;mid=sec&amp;oid=421&amp;aid=0000735711&amp;sid1=001\" target=_blank>http://news.naver.com/main/read.nhn?mode=LSD&amp;mid=sec&amp;oid=421&amp;aid=0000735711&amp;sid1=001</A>','N','Y',23,'','','','','','2014-03-20 00:00:00','N','','','','','','','','root','슈퍼관리자','2014-03-20 00:00:00',NULL,NULL),(2,2004,2,'1',1,'','주기적신고 - 건설업','<TABLE cellSpacing=1 cellPadding=2 width=780 align=center>\r\n<TBODY>\r\n<TR>\r\n<TD> <STRONG class=12pxnotice>신고요령</STRONG> </TD></TR>\r\n<TR>\r\n<TD>\r\n<TABLE cellSpacing=1 cellPadding=2 width=780 align=center>\r\n<TBODY>\r\n<TR>\r\n<TD>모든 서류는 신규등록에 준하여 준비하면 됨</TD></TR>\r\n<TR>\r\n<TD height=1 background=../image/wline.gif></TD></TR>\r\n<TR>\r\n<TD><IMG src=\"http://www.neobizmna.co.kr/image/bullet/wdot3.gif\" width=9 height=9> <B>제출시기</B> : 등록후 3년 경과한 날로부터 30일 이내 <BR><IMG src=\"http://www.neobizmna.co.kr/image/bullet/wdot3.gif\" width=9 height=9> <B>제출장소</B> : 일반건설은 특별시,광역시,도, 전문건설은 시,군,구 건설행정과 <BR><IMG src=\"http://www.neobizmna.co.kr/image/bullet/wdot3.gif\" width=9 height=9> <B>처리기관</B> : 접수일로 부터 30일 이내 </TD></TR></TBODY></TABLE></TD></TR></TBODY></TABLE><BR>\r\n<TABLE cellSpacing=1 cellPadding=2 width=780 align=center>\r\n<TBODY>\r\n<TR>\r\n<TD><IMG src=\"http://www.neobizmna.co.kr/img/bulit_01.gif\" width=8 height=11> <SPAN class=12pxnotice><STRONG class=orange>제출서류</STRONG></SPAN> </TD></TR>\r\n<TR>\r\n<TD>\r\n<TABLE cellSpacing=1 cellPadding=2 width=780 align=center>\r\n<TBODY>\r\n<TR>\r\n<TD>1) 건설업등록사항 신고서 <!--a href=\"hwp/form_01.hwp\"><img src=\"www/img/hwp.gif\" alt=\"건설업등록사항 신고서 다운받기\" border=\"0\"></a--><BR>2) 목차(신청자 작성) <BR>3) 법인등기부등본(개인사업자는 사업자등록증 사본) <BR>4) 재무관리상태진단보고서 (*전년도 결산재무제표로 갈음할 수 있음) <BR>5) 기술자보유증명서(한국건설기술인 협회 발급) \r\n<TABLE border=0 cellSpacing=1 cellPadding=1 width=\"100%\">\r\n<TBODY>\r\n<TR>\r\n<TD height=20 vAlign=top width=15></TD>\r\n<TD>\r\n<LI>각 기술자의 자격수첩 사본 또는 경력수첩 사본(원본지참) </LI></TD></TR></TBODY></TABLE>6) 조경공사업 &lt;토지확보 증빙서류 [폐지:2005.11.31]&gt; <BR><BR><SPAN class=price_blue><IMG src=\"http://www.neobizmna.co.kr/image/bullet/bule_sqr.gif\" width=9 height=9> <STRONG>참고사항</STRONG></SPAN> <BR>\r\n<TABLE border=0 cellSpacing=1 cellPadding=1 width=\"100%\">\r\n<TBODY>\r\n<TR>\r\n<TD height=20 vAlign=top width=15></TD>\r\n<TD>1) 모든 자료는 접수일 기준으로 1개월이내에 발급된 서류이어야 함. <BR>2) 2종이상을 겸유한 건설업자가 주기적신고기한이 도래한 건설업종을 신고하는 경우에, 나머지 업종이 신고기한이도래하지 않아도 일괄신고 할 수 있으며, 차기 갱신신고일은 일괄신고가 수리된 날이 된다.<BR>3) 갱신신고를 허위로 하거나 서류제출 불응시 등록말소 <BR>4) 갱신 미신고업체는 시정명령후 불응시 등록말소 <BR>5) 신고업체중 제출서류의 등록기준 미달시 영업정지 또는 등록말소 </TD></TR></TBODY></TABLE></TD></TR></TBODY></TABLE></TD></TR></TBODY></TABLE>','N','Y',27,'','','','','','2014-04-15 00:00:00','N','','','','','','','','root','슈퍼관리자','2014-04-15 00:00:00',NULL,NULL),(28,2004,28,'1',1,'','8/7일  주민등록번호 수집금지 ','<p><a href=\"http://www.mospablog.net/11811380\" target=\"_blank\">http://www.mospablog.net/11811380</a></p><p>건설업 양도양수 프라임코리아<br></p><p>건설면허 <br></p>','N','Y',10,'','','','','','2014-08-08 00:00:00','N','','','','','','','','root','슈퍼관리자','2014-08-08 00:00:00','root','2014-08-11 00:00:00'),(29,2004,29,'1',1,'','그들의 논리','&lt;iframe src=\"<a href=\"http://ebs.daum.net/knowledge/episode/1137/inner?outer\" target=\"_blank\">http://ebs.daum.net/knowledge/episode/1137/inner?outer</a>\" width=\"640\" height=\"360\" frameborder=\"0\" scrolling=\"no\"&gt;&lt;/iframe&gt;','N','Y',13,'','','','','','2014-08-26 00:00:00','N','','','','','','','','root','슈퍼관리자','2014-08-26 00:00:00',NULL,NULL),(10,2004,10,'1',1,'','기재사향변경신청서(전문)','...','N','Y',13,'','','','','','2014-04-28 00:00:00','N','','','','','','','','root','슈퍼관리자','2014-04-28 00:00:00',NULL,NULL),(11,2004,11,'1',1,'','기재사항변경신청서(일반)','...','N','Y',19,'','','','','','2014-04-28 00:00:00','N','','','','','','','','root','슈퍼관리자','2014-04-28 00:00:00',NULL,NULL),(27,2004,27,'1',1,'','행자부 입찰 기준 개정사항   2014년 8월 5일','<a href=\"http://www.mospa.go.kr/frt/bbs/type001/commonSelectBoardArticle.do?bbsId=BBSMSTR_000000000016&amp;nttId=43047\" target=\"_blank\">http://www.mospa.go.kr/frt/bbs/type001/commonSelectBoardArticle.do?bbsId=BBSMSTR_000000000016&amp;nttId=43047</a>','N','Y',14,'','','','','','2014-08-06 00:00:00','N','','','','','','','','root','슈퍼관리자','2014-08-06 00:00:00','root','2014-08-06 00:00:00'),(17,2004,17,'1',1,'','전문건설업 등록요건','...','N','Y',18,'','','','','','2014-04-29 00:00:00','N','','','','','','','','root','슈퍼관리자','2014-04-29 00:00:00',NULL,NULL),(18,2004,18,'1',1,'','일반건설업 등록요건','...','N','Y',16,'','','','','','2014-04-29 00:00:00','N','','','','','','','','root','슈퍼관리자','2014-04-29 00:00:00',NULL,NULL),(19,2004,19,'1',1,'','법인설립등기비용','...','N','Y',29,'','','','','','2014-04-29 00:00:00','N','','','','','','','','root','