11 00:00:00','N','','','','','','','','root','슈퍼관리자','2016-01-11 00:00:00',NULL,NULL),(34,2004,34,'1',1,'','주정차 단속 시스템 전국 통합','<a href=\"https://pvn.ts2020.kr/#none\" target=\"_blank\">https://pvn.ts2020.kr/#none</a>','N','Y',9,'','','','','','2014-10-28 00:00:00','N','','','','','','','','root','슈퍼관리자','2014-10-28 00:00:00',NULL,NULL),(35,2004,35,'1',1,'','양수자 인적사항','...','N','Y',25,'','','','','','2015-03-11 00:00:00','N','','','','','','','','root','슈퍼관리자','2015-03-11 00:00:00',NULL,NULL),(36,2004,36,'1',1,'','입찰기준  - 발주처별 투찰율 및 실적배수','...','N','Y',13,'','','','','','2015-03-11 00:00:00','N','','','','','','','','root','슈퍼관리자','2015-03-11 00:00:00',NULL,NULL),(37,2004,37,'1',1,'','게으름','<P>게으른 행동에 대한</P>\r\n<P>하늘이 주는 벌은</P>\r\n<P>두 가지 이다</P>\r\n<P>하나는 자신의 실패이고</P>\r\n<P>또 하나는</P>\r\n<P>내가 하지않은 일을 해낸</P>\r\n<P>다른 사람의 성공이다</P>','N','Y',12,'','','','','','2015-05-18 00:00:00','N','','','','','','','','root','슈퍼관리자','2015-05-18 00:00:00','root','2015-05-18 00:00:00'),(38,2004,38,'1',1,'','열가지 신기한 사실','<P>1. 비누로 눈을 씻을수 없다</P>\r\n<P>2. 당신은 당신의&nbsp; 머리카락 수를 셀수 없다</P>\r\n<P>3. 혀를 내민 상태에서&nbsp; 코로 숨을 쉴 수 없다</P>\r\n<P>4. 당신은 방금 3번을 시도 했다</P>\r\n<P>6. 3번을 시도 했을 때 </P>\r\n<P>&nbsp;&nbsp;&nbsp; 개처럼 보이기는 하지만 가능하다는 걸 알았다</P>\r\n<P>7. 당신은 속은걸 알고 지금 웃고 있다</P>\r\n<P>8. 당신은 5번을 건너 뛰었다</P>\r\n<P>9. 당신은 방금 5번이 있는지 확인 했다</P>\r\n<P>10. 이걸 친구들과 공유하면 더 재미 있다</P>','N','Y',25,'','','','','','2015-05-18 00:00:00','N','','','','','','','','root','슈퍼관리자','2015-05-18 00:00:00','root','2015-05-18 00:00:00');
